import React, { useState } from "react";
import axios from "axios";
import { Form, Button, Alert } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

const CreateTour = () => {
  const [form, setForm] = useState({
    title: "",
    description: "",
    location: "",
    price: "",
    duration: "",
    keyHighlights: "",
  });
  const [mainImage, setMainImage] = useState(null);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleFile = (e) => {
    setMainImage(e.target.files[0]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = new FormData();

    for (const key in form) data.append(key, form[key]);
    if (mainImage) data.append("mainImage", mainImage);

    try {
      await axios.post("http/api/tours", data, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      navigate("/admin/tours");
    } catch (err) {
      console.error(err);
      setError("Failed to create tour");
    }
  };

  return (
    <div className="container mt-4">
      <h3>Create Tour</h3>
      {error && <Alert variant="danger">{error}</Alert>}

      <Form onSubmit={handleSubmit} encType="multipart/form-data">
        <Form.Group className="mb-3">
          <Form.Label>Title</Form.Label>
          <Form.Control name="title" value={form.title} onChange={handleChange} required />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Description</Form.Label>
          <Form.Control name="description" value={form.description} onChange={handleChange} required as="textarea" />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Location</Form.Label>
          <Form.Control name="location" value={form.location} onChange={handleChange} required />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Price</Form.Label>
          <Form.Control name="price" value={form.price} onChange={handleChange} required />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Duration</Form.Label>
          <Form.Control name="duration" value={form.duration} onChange={handleChange} required />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Key Highlights (comma separated)</Form.Label>
          <Form.Control name="keyHighlights" value={form.keyHighlights} onChange={handleChange} />
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Label>Main Image</Form.Label>
          <Form.Control type="file" onChange={handleFile} />
        </Form.Group>

        <Button type="submit" variant="primary">Create Tour</Button>
      </Form>
    </div>
  );
};

export default CreateTour;
